    display: flex;
    flex-direction: column;
    margin: ${SPACING.large} 126px 0px 126px;
    align-items: center;
`;

const Main = () => {
    return(
        <MainArea>
            <SearchBar />
        </MainArea>
    );
}

export default Main;
